import React from 'react';
import imagezeta from '../../images/zetamonk_front.svg';
import cloud from '../../images/cloud.svg';
import {Landingsection,Imagewrapper,Image,Image1} from './LandingPage.element'
function LandingPage() {
    return (
      <Landingsection>
        
        <Image src={imagezeta}>

        </Image>
        <Image1 src={cloud}>

        </Image1>
        <Image2 src={cloud}>

        </Image2>

       
      </Landingsection>
    )
}

export default LandingPage
